import "./Expense.css";
import ExpenseItem from "./ExpenseItem";

function Expense(props) {
  const itemList = [];

  props.data.forEach((item) => {
    itemList.push(
      <div key={item.id}>
        <ExpenseItem
          title={item.title}
          date={item.date}
          amount={item.amount}
        ></ExpenseItem>
      </div>
    );
  });

  return (
    <div className="expenses">
      {props.data.map((item) => (
        <div key={item.id}>
          <ExpenseItem
            title={item.title}
            date={item.date}
            amount={item.amount}
          ></ExpenseItem>
        </div>
      ))}
    </div>
  );
}

export default Expense;

